css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("dailypress.com")

{

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, li, ul, h1, h2, h3, h4, h5, h6, form, #footer, #layerOne, .contentContainer, div.leadcontent, div.curvedContent, div.blurb, div.module, div.tabDisplay, div#container, div#siteOverview, .mv_headline, .mv_container ol, div.story, div#story-body-text, div.byline

{
color: white !important;
background: black !important;
}

/*links*/

a

{
color: #0040ff !important;
}

/*highlight*/

textarea, pre

{
background: #333333 !important;
}

}
